import React from "react";
import { Redirect } from "react-router-dom";
const Home = React.lazy(() => import("./ContentComponents/Home/Home"));
const Genres = React.lazy(() => import("./ContentComponents/Genres/Genres"));
const Artists = React.lazy(() => import("./ContentComponents/Artists/Artists"));
const Music = React.lazy(() => import("./ContentComponents/Music/Music"));
const Stations = React.lazy(() =>
  import("./ContentComponents/Station/Station")
);

export const routes = [
  {
    path: "/",
    exact: true,
    main: () => <Redirect to="/home" />,
  },
  {
    path: "/genres",
    exact: true,
    main: Genres,
  },
  {
    path: "/music",
    main: Music,
  },
  {
    path: "/artists",
    main: Artists,
  },
  {
    path: "/stations",
    main: Stations,
  },
];
export default routes;
